import React from 'react';
import { useSelector, useDispatch } from 'react-redux'
import { increment, decrement } from '../reducers/counterReducer';
import { setUser } from '../reducers/userReducer';

const MainContainer = () => {

  const dispatch = useDispatch();

  const counter = useSelector(state => state.counter);
  const userState = useSelector(state => state.currentUser);
  console.log(userState.currentUser);

  return (
    <div>
      <button onClick={() => dispatch(increment(counter))}>+</button>
      <button onClick={() => dispatch(decrement(counter))}>-</button>
      <button onClick={() => dispatch(setUser("Caleb"))}>Set User</button>
      Counter: {counter}
    </div>
  )
};

export default MainContainer;
